import React from 'react'
import TeamMember from './TeamMember'

function Team() {
    return(
        <div className='row'>
        <TeamMember name='Nour Homsi' />
        <TeamMember name='Khaled Alkilani'/>
        <TeamMember name='Captin Majed' />
        </div>
    )
}

export default Team
